import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="app-wrapper">
      <header className="header">
        <img src="https://2.allegroimg.com/s1440/03d90d/56ee6aa4493c81e8599f9d81fea2"/>
      </header>
        <nav className="nav">
            <div>Profile</div>
            <div>Messages</div>
        </nav>
        <div className="content">
            Main content
        </div>
    </div>
  );
};

export default App;
